import React, { Component } from 'react';
import { BrowserRouter } from 'react-router-dom'
import Navbar from './componets/layout/Navbar.js'

class App extends Component {
  render () {
    return (
      <BrowserRouter>
        <div className="App">
          <Navbar/>
          <Switch>
            <Route path="/"></Route>
          </Switch>
        </div>
      </BrowserRouter>
    );
  }
}

export default App;
